const grayCanvas = document.getElementById('canvasGrayScale');
const ctx = grayCanvas.getContext('2d');

grayCanvas.width = 1500;
grayCanvas.height = 999;

const grayImage = new Image();

//grayImage.src = 'photo.jpg';
grayImage.src = 'data:image/jpeg;base64,';

grayImage.addEventListener('load', function () {
    ctx.drawImage(grayImage, 0, 0, grayCanvas.width, grayCanvas.height);
    const scanImage = ctx.getImageData(0, 0, grayCanvas.width, grayCanvas.height);
    console.log(scanImage)
    const scanData = scanImage.data;

    for(let i =0; i<scanData.length; i+=4) {
        const sumColor = scanData[i] + scanData[i+1] + scanData[i+2];
        const avgColor = sumColor/3;
        scanData[i] = avgColor;
        scanData[i+1] = avgColor;
        scanData[i+2] = avgColor;
    }
    scanImage.data = scanData;
    ctx.putImageData(scanImage, 0, 0)
})